import { Container, InputSearchContainer } from '../Header/';

import logo from '../../assets/images/logo.svg';

export default function Header() {
  return (
    <Container>
      <img src={logo} alt="MyContacts" />

      <InputSearchContainer>
        <input type="text" />
      </InputSearchContainer>
    </Container>
  );
}
